"use strict";(self.webpackChunkspanish_app=self.webpackChunkspanish_app||[]).push([[274],{1274:e=>{e.exports=JSON.parse('{"6":{"words":[{"spanish":"Rojo","english":"Red"},{"spanish":"Azul","english":"Blue"},{"spanish":"Verde","english":"Green"},{"spanish":"Amarillo","english":"Yellow"},{"spanish":"Blanco","english":"White"},{"spanish":"Negro","english":"Black"},{"spanish":"Gris","english":"Gray"},{"spanish":"Marr\xf3n","english":"Brown"},{"spanish":"Grande","english":"Big"},{"spanish":"Peque\xf1o","english":"Small"},{"spanish":"Alto","english":"Tall"},{"spanish":"Bajo","english":"Short"},{"spanish":"Largo","english":"Long"},{"spanish":"Corto","english":"Short"},{"spanish":"Bonito","english":"Pretty"},{"spanish":"Feo","english":"Ugly"},{"spanish":"Nuevo","english":"New"},{"spanish":"Viejo","english":"Old"},{"spanish":"Limpio","english":"Clean"},{"spanish":"Sucio","english":"Dirty"},{"spanish":"F\xe1cil","english":"Easy"},{"spanish":"Dif\xedcil","english":"Difficult"},{"spanish":"Feliz","english":"Happy"},{"spanish":"Triste","english":"Sad"},{"spanish":"La mesa es grande","english":"The table is big"},{"spanish":"El perro es peque\xf1o","english":"The dog is small"},{"spanish":"La camiseta es roja","english":"The t-shirt is red"},{"spanish":"El pantal\xf3n es azul","english":"The pants are blue"},{"spanish":"Mi amigo es alto","english":"My friend is tall"},{"spanish":"Mi amiga es baja","english":"My friend is short"},{"spanish":"La casa es vieja","english":"The house is old"}],"conversations":[{"id":1,"topic":"Describiendo un carro","dialog":[{"speaker":"Carlos","spanish":"Compr\xe9 un carro nuevo. Es muy bonito.","english":"I bought a new car. It\'s very pretty."},{"speaker":"Mar\xeda","spanish":"\xbfDe qu\xe9 color es?","english":"What color is it?"},{"speaker":"Carlos","spanish":"Es azul. Y es un carro peque\xf1o.","english":"It\'s blue. And it\'s a small car."},{"speaker":"Mar\xeda","spanish":"\xa1Qu\xe9 bien! Mi carro es viejo y grande, y es de color negro.","english":"How nice! My car is old and big, and it\'s black."},{"speaker":"Carlos","spanish":"Mi carro azul es m\xe1s r\xe1pido que tu carro negro.","english":"My blue car is faster than your black car."}],"questions":[{"question":"\xbfDe qu\xe9 color es el carro de Carlos?","options":["Rojo","Negro","Azul","Blanco"],"answer":"Azul","answerIndex":2},{"question":"\xbfC\xf3mo es el carro de Mar\xeda?","options":["Nuevo y peque\xf1o","Viejo y grande","Bonito y azul","Nuevo y negro"],"answer":"Viejo y grande","answerIndex":1},{"question":"\xbfQu\xe9 significa \'es m\xe1s r\xe1pido\'?","options":["It is slower","It is bigger","It is newer","It is faster"],"answer":"It is faster","answerIndex":3}]},{"id":2,"topic":"Describiendo personas","dialog":[{"speaker":"Ana","spanish":"\xbfQui\xe9n es tu hermano?","english":"Who is your brother?"},{"speaker":"Luis","spanish":"Mi hermano es el chico alto con la camiseta amarilla.","english":"My brother is the tall boy with the yellow t-shirt."},{"speaker":"Ana","spanish":"Ah, lo veo. \xbfY qui\xe9n es la chica baja?","english":"Ah, I see him. And who is the short girl?"},{"speaker":"Luis","spanish":"Ella es mi amiga Elena. Tiene el pelo largo y negro.","english":"She is my friend Elena. She has long, black hair."},{"speaker":"Ana","spanish":"Es muy bonita.","english":"She is very pretty."}],"questions":[{"question":"\xbfC\xf3mo es el hermano de Luis?","options":["Es bajo","Es alto","Es feo","Tiene el pelo largo"],"answer":"Es alto","answerIndex":1},{"question":"\xbfQu\xe9 color tiene la camiseta del hermano?","options":["Roja","Azul","Amarilla","Negra"],"answer":"Amarilla","answerIndex":2},{"question":"\xbfC\xf3mo es el pelo de Elena?","options":["Corto y negro","Largo y rubio","Largo y negro","Corto y amarillo"],"answer":"Largo y negro","answerIndex":2}]},{"id":3,"topic":"Comparando objetos","dialog":[{"speaker":"Juan","spanish":"\xbfCu\xe1l libro es m\xe1s interesante, el rojo o el gris?","english":"Which book is more interesting, the red one or the gray one?"},{"speaker":"Marta","spanish":"El libro rojo es viejo, pero es muy interesante.","english":"The red book is old, but it is very interesting."},{"speaker":"Juan","spanish":"\xbfY el libro gris?","english":"And the gray book?"},{"speaker":"Marta","spanish":"Es un libro nuevo, pero es dif\xedcil de leer. El viejo es mejor.","english":"It is a new book, but it is difficult to read. The old one is better."},{"speaker":"Juan","spanish":"Entonces leer\xe9 el libro rojo.","english":"Then I will read the red book."}],"questions":[{"question":"\xbfQu\xe9 color tiene el libro viejo?","options":["Gris","Amarillo","Rojo","Negro"],"answer":"Rojo","answerIndex":2},{"question":"\xbfC\xf3mo es el libro nuevo?","options":["F\xe1cil de leer","Interesante","Viejo","Dif\xedcil de leer"],"answer":"Dif\xedcil de leer","answerIndex":3},{"question":"\xbfQu\xe9 significa \'El viejo es mejor\'?","options":["The new one is better","The old one is better","The gray one is worse","The red one is worse"],"answer":"The old one is better","answerIndex":1}]},{"id":4,"topic":"Describiendo un lugar","dialog":[{"speaker":"Roberto","spanish":"Ayer fui a un parque. Era un parque muy grande.","english":"Yesterday I went to a park. It was a very big park."},{"speaker":"Silvia","spanish":"\xbfY c\xf3mo era? \xbfHab\xeda \xe1rboles grandes?","english":"And what was it like? Were there big trees?"},{"speaker":"Roberto","spanish":"S\xed, hab\xeda muchos \xe1rboles verdes y un lago azul. \xa1Muy bonito!","english":"Yes, there were many green trees and a blue lake. Very pretty!"},{"speaker":"Silvia","spanish":"Suena a un lugar tranquilo.","english":"It sounds like a quiet place."},{"speaker":"Roberto","spanish":"S\xed, era un lugar tranquilo y limpio.","english":"Yes, it was a quiet and clean place."}],"questions":[{"question":"\xbfC\xf3mo era el parque?","options":["Peque\xf1o y sucio","Grande y bonito","Grande y feo","Peque\xf1o y tranquilo"],"answer":"Grande y bonito","answerIndex":1},{"question":"\xbfQu\xe9 color ten\xedan los \xe1rboles?","options":["Azules","Amarillos","Verdes","Rojos"],"answer":"Verdes","answerIndex":2},{"question":"\xbfQu\xe9 significa \'un lugar tranquilo\'?","options":["A busy place","A big place","A quiet place","A dirty place"],"answer":"A quiet place","answerIndex":2}]},{"id":5,"topic":"Buscando un objeto","dialog":[{"speaker":"David","spanish":"Busco mis llaves. No las encuentro.","english":"I am looking for my keys. I can\'t find them."},{"speaker":"Laura","spanish":"\xbfC\xf3mo son?","english":"What are they like?"},{"speaker":"David","spanish":"Son peque\xf1as y de color gris.","english":"They are small and gray."},{"speaker":"Laura","spanish":"\xbfEst\xe1n en la mesa peque\xf1a?","english":"Are they on the small table?"},{"speaker":"David","spanish":"No, no est\xe1n ah\xed. \xa1Las encontr\xe9! Estaban en la silla azul.","english":"No, they are not there. I found them! They were on the blue chair."}],"questions":[{"question":"\xbfC\xf3mo son las llaves de David?","options":["Grandes y rojas","Peque\xf1as y grises","Grandes y azules","Peque\xf1as y negras"],"answer":"Peque\xf1as y grises","answerIndex":1},{"question":"\xbfD\xf3nde encontr\xf3 David sus llaves?","options":["En la mesa peque\xf1a","En la silla roja","En el suelo","En la silla azul"],"answer":"En la silla azul","answerIndex":3},{"question":"\xbfQu\xe9 significa \'No las encuentro\'?","options":["I found them","I can\'t find them","I lost them","I need them"],"answer":"I can\'t find them","answerIndex":1}]}],"stories":[{"id":1,"title":"Mis Mascotas","sentences":[{"spanish":"Tengo dos mascotas, un perro y un gato.","english":"I have two pets, a dog and a cat."},{"spanish":"Mi perro se llama Max. Es grande, negro y un poco viejo.","english":"My dog is named Max. He is big, black, and a little old."},{"spanish":"Es un perro muy feliz y amigable. Le gusta correr en el jard\xedn.","english":"He is a very happy and friendly dog. He likes to run in the garden."},{"spanish":"Mi gato se llama Luna. Es peque\xf1o, blanco y tiene ojos verdes.","english":"My cat is named Luna. She is small, white, and has green eyes."},{"spanish":"Luna es una gata tranquila y un poco t\xedmida.","english":"Luna is a calm and a little shy cat."},{"spanish":"A ella le gusta dormir en una silla peque\xf1a y limpia.","english":"She likes to sleep in a small, clean chair."},{"spanish":"Max y Luna son diferentes, pero los dos son muy bonitos.","english":"Max and Luna are different, but both are very pretty."}]},{"id":2,"title":"Una Ciudad Vieja","sentences":[{"spanish":"Visit\xe9 una ciudad vieja el verano pasado.","english":"I visited an old city last summer."},{"spanish":"Las calles eran estrechas y los edificios eran altos.","english":"The streets were narrow and the buildings were tall."},{"spanish":"Hab\xeda muchas casas viejas y bonitas de diferentes colores.","english":"There were many old and pretty houses of different colors."},{"spanish":"Vi una casa roja con una puerta azul.","english":"I saw a red house with a blue door."},{"spanish":"Tambi\xe9n visit\xe9 un museo. Era un edificio muy grande.","english":"I also visited a museum. It was a very big building."},{"spanish":"Dentro, hab\xeda muchos cuadros y esculturas famosas.","english":"Inside, there were many famous paintings and sculptures."},{"spanish":"La ciudad era interesante y me gust\xf3 mucho.","english":"The city was interesting and I liked it a lot."}]},{"id":3,"title":"La Tienda de Ropa","sentences":[{"spanish":"Fui a la tienda de ropa para comprar un regalo.","english":"I went to the clothing store to buy a gift."},{"spanish":"Mi amigo quiere una camisa nueva. Su color favorito es el verde.","english":"My friend wants a new shirt. His favorite color is green."},{"spanish":"Vi una camisa verde muy bonita, pero era demasiado grande.","english":"I saw a very pretty green shirt, but it was too big."},{"spanish":"Busqu\xe9 otra camisa. Encontr\xe9 una camisa azul, pero no era el color que \xe9l quer\xeda.","english":"I looked for another shirt. I found a blue shirt, but it was not the color he wanted."},{"spanish":"Finalmente, encontr\xe9 una camisa verde. Era una camisa peque\xf1a y limpia.","english":"Finally, I found a green shirt. It was a small and clean shirt."},{"spanish":"El pantal\xf3n de mi amigo es largo, pero su camisa es corta.","english":"My friend\'s pants are long, but his shirt is short."},{"spanish":"El regalo es perfecto.","english":"The gift is perfect."}]}],"speaking":{"title":"Descripci\xf3n de Cosas","description":"Preguntas y respuestas para practicar la descripci\xf3n de objetos, personas y lugares con adjetivos.","questions_and_answers":[{"question":{"spanish":"\xbfDe qu\xe9 color es tu carro?","english":"What color is your car?"},"answer":{"spanish":"Mi carro es azul y viejo.","english":"My car is blue and old."}},{"question":{"spanish":"\xbfC\xf3mo es la casa de tu amigo?","english":"What is your friend\'s house like?"},"answer":{"spanish":"Su casa es grande y bonita.","english":"His house is big and pretty."}},{"question":{"spanish":"\xbfDe qu\xe9 color es la camiseta que tienes puesta?","english":"What color is the t-shirt you are wearing?"},"answer":{"spanish":"Mi camiseta es roja y corta.","english":"My t-shirt is red and short."}},{"question":{"spanish":"\xbfC\xf3mo es tu dormitorio?","english":"What is your bedroom like?"},"answer":{"spanish":"Mi dormitorio es peque\xf1o y limpio.","english":"My bedroom is small and clean."}},{"question":{"spanish":"\xbfDe qu\xe9 color son tus ojos?","english":"What color are your eyes?"},"answer":{"spanish":"Mis ojos son marrones.","english":"My eyes are brown."}},{"question":{"spanish":"\xbfTienes el pelo largo o corto?","english":"Do you have long or short hair?"},"answer":{"spanish":"Yo tengo el pelo corto y negro.","english":"I have short and black hair."}},{"question":{"spanish":"\xbfLa clase de espa\xf1ol es f\xe1cil o dif\xedcil?","english":"Is the Spanish class easy or difficult?"},"answer":{"spanish":"La clase es dif\xedcil, pero es interesante.","english":"The class is difficult, but it is interesting."}},{"question":{"spanish":"\xbfC\xf3mo es la silla de tu escritorio?","english":"What is your desk chair like?"},"answer":{"spanish":"Mi silla es gris y vieja.","english":"My chair is gray and old."}},{"question":{"spanish":"\xbfC\xf3mo es tu mascota?","english":"What is your pet like?"},"answer":{"spanish":"Mi perro es grande y negro. Es muy feliz.","english":"My dog is big and black. He is very happy."}},{"question":{"spanish":"\xbfDe qu\xe9 color es el sof\xe1 en tu sala?","english":"What color is the sofa in your living room?"},"answer":{"spanish":"El sof\xe1 es rojo y grande.","english":"The sofa is red and big."}},{"question":{"spanish":"\xbfC\xf3mo es el lago en el parque?","english":"What is the lake in the park like?"},"answer":{"spanish":"El lago es azul y muy bonito.","english":"The lake is blue and very pretty."}},{"question":{"spanish":"\xbfTu amigo es alto o bajo?","english":"Is your friend tall or short?"},"answer":{"spanish":"Mi amigo es alto y simp\xe1tico.","english":"My friend is tall and friendly."}},{"question":{"spanish":"\xbfC\xf3mo es la puerta de tu casa?","english":"What is the door of your house like?"},"answer":{"spanish":"La puerta es grande y verde.","english":"The door is big and green."}},{"question":{"spanish":"\xbfTu ciudad es limpia o sucia?","english":"Is your city clean or dirty?"},"answer":{"spanish":"Mi ciudad es limpia y tranquila.","english":"My city is clean and quiet."}},{"question":{"spanish":"\xbfQu\xe9 color es tu libro favorito?","english":"What color is your favorite book?"},"answer":{"spanish":"Mi libro favorito es el gris.","english":"My favorite book is the gray one."}},{"question":{"spanish":"\xbfLa silla es nueva o vieja?","english":"Is the chair new or old?"},"answer":{"spanish":"La silla es muy vieja, pero es c\xf3moda.","english":"The chair is very old, but it is comfortable."}},{"question":{"spanish":"\xbfC\xf3mo es tu prima?","english":"What is your female cousin like?"},"answer":{"spanish":"Mi prima es baja y muy divertida.","english":"My female cousin is short and very funny."}},{"question":{"spanish":"\xbfTu trabajo es f\xe1cil o dif\xedcil?","english":"Is your job easy or difficult?"},"answer":{"spanish":"Mi trabajo es dif\xedcil, pero soy feliz.","english":"My job is difficult, but I am happy."}},{"question":{"spanish":"\xbfTu gato es peque\xf1o?","english":"Is your cat small?"},"answer":{"spanish":"S\xed, mi gato es muy peque\xf1o y blanco.","english":"Yes, my cat is very small and white."}},{"question":{"spanish":"\xbfQu\xe9 color de pantal\xf3n te gusta?","english":"What color pants do you like?"},"answer":{"spanish":"Me gusta el pantal\xf3n azul.","english":"I like the blue pants."}}]}}}')}}]);